def:
Высота расположения верхнего этажа, не считая верхнего технического этажа, определяемая:
- максимальной разностью отметок поверхности проезда для пожарных машин и нижней границы открывающегося проема (окна) в наружной стене;
- полусуммой отметок пола и потолка этажа при отсутствии открывающихся окон (проемов)

list:
1-й тип - внутренние, размещаемые на лестничных клетках;
2-й тип - внутренние открытые;
3-й тип - наружные открытые

H1 - лестничные клетки с входом на лестничную клетку с этажа через незадымляемую наружную воздушную зону по открытым переходам; 
 Н2 - лестничные клетки с подпором воздуха на лестничную клетку при пожаре 
 Н3 - лестничные клетки с входом на них на каждом этаже через тамбур-шлюз, в котором постоянно или во время пожара обеспечивается подпор воздуха.
